LL,NULL,'1.03',0,'Select all that apply:','Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641368','mc',0,'Using systematic and extensive profiling or automated decision making to make important decisions about individuals, Processing special category data or criminal offence data on a large scale, Systematic monitoring of publicly accessible premises on a large scale, Using new technologies, Using profiling or automated decision making or special category data to help make decisions about an individual\'s access to a service or opportunity or benefit, Profiling on a large scale, Processing biometric or genetic data, Combining or comparing or matching data from multiple sources, Processing personal data without providing a privacy policy directly to the individual, Processing personal data in a way that involves tracking the location or behaviour of individuals online or offline, Processing children\'s personal data for profiling or automated decision making or marketing purposes or by offering online services directly to them, Processing personal data that may result in a risk of physical harm in the event of a security breach, Not sure, Not applicable','Utilisation d\'un profilage systématique et étendu ou d\'une prise de décision automatisée pour prendre des décisions importantes sur les personnes, Traitement à grande échelle des données de catégories spéciales ou de données sur les infractions pénales, Surveillance systématique des lieux accessibles au public à grande échelle, Utiliser les nouvelles technologies, Utilisation du profilage ou de la prise de décision automatisée ou des données de catégories  l\'accès d\'une personne à un service ou une opportunité ou un avantage, Réalisation de profils à grande échelle, Traitement des données biométriques ou génétiques, Combiner ou comparer ou faire correspondre des données provenant de plusieurs sources, Traitement des données personnelles sans fournir une politique de confidentialité directement à la personne, Traitement des données personnelles d\'une manière qui implique le suivi de l\'emplacement ou du comportement des individus en ligne ou hors ligne, Traitement des données personnelles des enfants à des fins de profilage ou de prise de décision automatisée ou à des fins de marketing ou en leur offrant des services en ligne directement, Traitement des données personnelles pouvant entraîner un risque de préjudice physique en cas d\'atteinte à la sécurité, Pas certain, Non applicable','',329,1,245,NULL,NULL,'yes','null',NULL,NULL,'Activity element','éléments',0),(641369,'Are any of the data already publicly available?','Certaines des données sont-elles déjà accessibles au public ?',NULL,NULL,'1.04',0,NULL,NULL,0,0,0,0,NULL,'q-641369','sc',0,'Yes, No, Not Sure','Oui, Non, Pas certain','',329,1,245,NULL,NULL,'yes','null',NULL,NULL,'Availability of data','données accessibles',0),(641370,'Would you consider this activity to be very similar to another activity for which a DPIA has already been carried out?','Considérez-vous que cette activité est très similaire à une autre activité pour laquelle une DPIA a déjà été réalisée ?',NULL,NULL,'1.05',0,NULL,NULL,0,0,0,0,NULL,'q-641370','sc',0,'Yes, No, Not Sure','Oui, Non, Pas certain','',329,1,245,NULL,NULL,'yes','null',NULL,NULL,'Similarity','Similitude',0),(641371,'Did you select \'legitimate interests\' as your legal basis for processing?','Avez-vous sélectionné les « intérêts légitimes » comme base juridique pour le traitement?',NULL,NULL,'1.06',0,NULL,NULL,0,0,0,0,NULL,'q-641371','sc',0,'Yes, No','Oui, Non','',329,1,245,NULL,NULL,'yes','null',NULL,NULL,'Legal basis','Base juridique',0),(641372,'What steps have you taken to ensure that the data are processed fairly?','Quelles mesures avez-vous pris pour garantir un traitement équitable des données ?',NULL,NULL,'2.01',0,'Please choose from the following, and/or add your own. Select all that apply:','Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641372','mc',0,'Privacy notices are presented to users, User privacy settings are set to the most protective as the default, Users are notified of default privacy settings and how to change them, Privacy tools or settings and functionalities are clear or conspicuous or easy to find and user-friendly, Not Sure, Not Applicable, Other','Des avis de confidentialité sont présentés aux utilisateurs, Les paramètres de confidentialité de l\'utilisateur sont définis sur le plus protecteur par défaut, Les utilisateurs sont informés des paramètres de confidentialité par défaut et de la façon de les modifier, Les outils ou paramètres et fonctionnalités de confidentialité sont clairs ou visibles ou faciles à trouver et conviviaux, Pas certain, Non applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Steps','Les étapes',0),(641373,'What steps have you taken to ensure that the data are processed in a transparent manner?','Quelles mesures avez-vous prises pour garantir que les données sont traitées de manière transparente ?',NULL,NULL,'2.02',0,'Please choose from the following, and/or add your own. Select all that apply:','Veuillez choisir parmi les éléments suivants et/ou ajouter le vôtre. Sélectionnez tout ce qui s\'y rapporte:',0,0,0,0,NULL,'q-641373','mc',0,'Users are made aware of who is collecting/using their data, Users are provided with the ability to report problems/concerns, A privacy dashboard is provided to users, Browser add-ons to assist with privacy are provided to users, Privacy seals or certifications or logos are presented to users, Not Sure, Not Applicable, Other','Les utilisateurs sont informés de qui collecte/utilise leurs données, Les utilisateurs ont la possibilité de signaler des problèmes/préoccupations, Un tableau de bord de confidentialité est fourni aux utilisateurs, Des modules complémentaires de navigateur pour aider à la confidentialité sont fournis aux utilisateurs, Les sceaux de confidentialité ou les certifications ou les logos sont présentés aux utilisateurs, Pas certain, Non applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Transparent','Transparent',0),(641374,'What steps have you taken to ensure that the data are collected and used only for specified, explicit and legitimate purposes?','Quelles mesures avez-vous pris pour garantir que les données sont collectées et utilisées uniquement à des fins spécifiées, explicites et légitimes ?',NULL,NULL,'2.03',0,'Please choose from the following, and/or add your own. Select all that apply:','Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641374','mc',0,'The purpose of every data element is identified prior to collection, The specific purpose for every data element is documented, Data are never collected to have just in case, Not Sure, Not Applicable, Other','Le but de chaque type de données est identifié avant la collecte, Le but spécifique de chaque type de données est documenté, Les données ne sont jamais collectées pour les avoir au cas où, Pas certain, Non applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Explicit','Explicite',0),(641375,'What steps have you taken to ensure that data are not further processed in a manner that is incompatible with those purposes?','Quelles mesures avez-vous pris pour garantir que les données ne soient pas traitées ultérieurement d\'une manière incompatible avec ces finalités ?',NULL,NULL,'2.04',0,'Please choose from the following, and/or add your own. Select all that apply:','Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641375','mc',0,'Processing or utilisation and transfer rights are restricted, Company policies are in place to minimise our exposure to hackers, Quality assurance revisions are in place for compliance in software development, Separation exists between organisational and departmental boundaries, Role concepts with differentiated access rights on the basis of identity management and secure authentication methods are in place, Purpose specific pseudonyms or anonymisation services and/or anonymous credentials are used, Regulated procedures are in place for purpose amendments, Not Sure, Not Applicable, Other','Les droits de traitement ou d\'utilisation et de transfert sont limités, Des politiques d\'entreprise sont en place pour minimiser notre exposition aux piratages, Des révisions d\'assurance qualité sont en place pour assurer la conformité dans le développement de logiciels, Il existe une séparation entre les limites organisationnelles et départementales, Des concepts de rôle avec des droits d\'accès différenciés sur la base de la gestion des identités et des méthodes d\'authentification sécurisées sont en place, Des pseudonymes spécifiques ou des services d\'anonymisation et / ou des informations d\'identification anonymes sont utilisés, Des procédures réglementées sont en place pour les modifications d\'objet, Pas certain, Non applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Incompatible','Incompatible',0),(641376,'For what additional purpose(s) is the data processed?','Dans quel (s) but (s) supplémentaire (s) les données sont-elles traitées ?',NULL,NULL,'2.05',0,'If the data are not processed for any additional purposes, select \"Not Applicable.\" Select all that apply:','Si les données ne sont pas traitées à d\'autres fins, sélectionnez « Non applicable ». Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641376','mc',0,'Archiving purposes in the public interest, Scientific research, Historical research, Statistical purposes, Not Sure, Not Applicable, Other','Archivage à des fins d\'intérêt public, Recherche scientifique, Recherche historique, Fins statistiques, Pas certain, Non applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Additional purpose','Supplémentaire',0),(641377,'What steps have you taken to ensure that the data are limited to what is necessary for the purpose of this activity?','Quelles mesures avez-vous pris pour vous assurer que les données sont limitées à ce qui est nécessaire aux fins de cette activité ?',NULL,NULL,'2.06',0,'Please choose from the following, and/or add your own. Select all that apply:','Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641377','mc',0,'Data is verified for adequacy in achieving its purpose, No more is collected/kept than is necessary to achieve a specific purpose, Data to be transferred is limited to that which is minimally necessary to achieve the purpose of the transfer, We have implemented automatic blocking and erasure routines, The user-interface (UI) distinguishes between optional and required fields, Use of free-form text fields is avoided, Defined fields (e.g. pre-populated lists/dropdowns.) are used in favor of free-form text fields, Not Sure, Not Applicable, Other','Les données sont vérifiées quant à leur adéquation pour atteindre leur objectif, Il n\'y a pas plus de collecte / conservation que nécessaire pour atteindre un objectif spécifique, Les données à transférer sont limitées à celles qui sont nécessaires au minimum pour atteindre l\'objectif du transfert, Nous avons mis en place des routines de blocage et d\'effacement automatiques, L\'interface utilisateur (IU) fait la distinction entre les champs facultatifs et obligatoires, L\'utilisation de champs de texte sous forme libre est évitée, Les champs définis (ex : listes déroulantes préremplies) sont utilisés en faveur des champs de texte de forme libre, Pas certain, Non applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Limitation','Limitation',0),(641378,'What steps have you taken to ensure that the data are relevant to the purposes of this activity?','Quelles mesures avez-vous prises pour vous assurer que les données sont pertinentes aux fins de cette activité ?',NULL,NULL,'2.07',0,'Please choose from the following, and/or add your own. Select all that apply:','Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641378','mc',0,'Every data element is verified for relevance to a specific purpose, We have the capability to limit the collection of a specific data element if the need arises, The user interface (UI) distinguishes between optional and required fields, Use of free-form text fields is avoided, Defined fields (e.g. pre-populated lists/dropdowns) are used in favor of free-form text fields, Not Sure, Not Applicable, Other','Chaque élément de données est vérifié pour sa pertinence par rapport à un objectif spécifique, Nous avons la possibilité de limiter la collecte d\'un élément de données spécifique si le besoin s\'en fait sentir, L\'interface utilisateur (UI) fait la distinction entre les champs facultatifs et obligatoires, L\'utilisation de champs de texte de forme libre est évitée, Les champs définis (par exemple : les listes/listes déroulantes pré-remplies) sont utilisés en faveur des champs de texte de forme libre, Pas certain, N\'est pas applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Relevant data','Données pertinentes',0),(641379,'What steps have you taken to ensure that the data are accurate?','Quelles mesures avez-vous pris pour garantir l\'exactitude des données ?',NULL,NULL,'2.08',0,'Please choose from the following, and/or add your own. Select all that apply:','Sélectionnez tout ce qui s\'y rapporte :',0,0,0,0,NULL,'q-641379','mc',0,'Controls are in place for periodically checking the accuracy and quality of data, Validation controls are in place to filter out inconsistent or incomplete and inaccurate data, Not Sure, Not Applicable, Other','Des contrôles sont en place pour vérifier périodiquement l\'exactitude et la qualité des données, Des contrôles de validation sont en place pour filtrer les données incohérentes ou incomplètes et inexactes, Pas certain, Non applicable, Autre','',330,1,245,NULL,NULL,'yes','null',NULL,NULL,'Accurate data','Des données précises',0),(641380,'What steps have you taken to ensure that the data are kept up to date?','Quelles mesures avez-vous pris pour garantir la mise à jour des don