 privacy notice, or have different notices that you will provide to data subjects prior to processing their personal data.','L\'avis de confidentialité est, très souvent, fourni sur le site Web de votre organisation. Il est important de définir la portée de vos avis de confidentialité afin que les individus aient facilement accès aux informations requises pour chaque activité de traitement. Vous pouvez choisir d\'inclure toutes vos activités de traitement dans un seul avis de confidentialité, ou d\'avoir différents avis que vous fournirez aux personnes concernées avant de traiter leurs données personnelles.',0,0,0,0,NULL,'q-642837','sc',0,'Yes, No','Oui, Non','',633,1,398,NULL,NULL,'yes','null',NULL,NULL,NULL,NULL,0),(642838,'Does your privacy notice clearly state the identity and contact details of the controller (and the controller\'s representative, where applicable)?','Votre politique de confidentialité indique-t-elle clairement l\'identité et les coordonnées du responsable du traitement (et du représentant du responsable, le cas échéant) ?',NULL,NULL,'1.02',0,'This includes the name and address of your organisation. It can also include the legal or privacy department\'s e-mail address and/or phone number.','Cela inclut le nom et l\'adresse de votre organisation. Il peut également inclure l\'adresse e-mail et/ou le numéro de téléphone du service juridique ou de la protection de la vie privée.',0,0,0,0,NULL,'q-642838','sc',0,'Yes, No','Oui, Non','',633,1,398,NULL,NULL,'yes','null',NULL,NULL,NULL,NULL,0),(642839,'Does your privacy notice include the contact details of the data protection officer?','Votre avis de confidentialité comprend-il les coordonnées du délégué à la protection des données?',NULL,NULL,'1.03',0,'If your organisation does not have a data protection officer (i.e if it does not fall under the cases that require appointing a DPO and it did not choose to appoint one), click \'Not Applicable\'. \r\n\r\n\r\nContact details can include, for example, the DPO\'s name, e-mail address and phone number.','Si votre organisation n\'a pas de délégué à la protection des données (c\'est-à-dire si elle ne relève pas des cas nécessitant la nomination d\'un DPD et qu\'elle n\'a pas choisi d\'en nommer un), cliquez sur « Non applicable ».\r\n\r\nLes coordonnées peuvent inclure, par exemple, le nom du DPD, son adresse e-mail et son numéro de téléphone.',0,0,0,0,NULL,'q-642839','sc',0,'Yes, No, Not Applicable','Oui, Non, Non applicable','',633,1,398,NULL,NULL,'yes','null',NULL,NULL,NULL,NULL,0),(642840,'Does your privacy notice state why you are processing personal data (i.e., the purposes of processing), as well as the legal basis for such purposes?','Votre politique de confidentialité indique-t-elle pourquoi vous traitez des données personnelles (c\'est-à-dire les finalités du traitement), ainsi que la base juridique à ces fins ?',NULL,NULL,'1.04',0,'For example, you may collect and process personal data for marketing purposes on the basis of consent.','Par exemple, vous pouvez collecter et traiter des données personnelles à des fins de marketing sur la base d\'un consentement.',0,0,0,0,NULL,'q-642840','sc',0,'Yes, No','Oui, Non','',633,1,398,NULL,NULL,'yes','null',NULL,NULL,NULL,NULL,0),(642841,'For the processing activities which are based on the legitimate interest of your organisation, does your privacy notice describe what those legitimate interests pursued by you (controller) or a third party are?','Pour les activités de traitement qui sont basées sur l\'intérêt légitime de votre organisation, votre politique de confidentialité décrit-elle quels sont ces intérêts légitimes poursuivis par vous (responsable du traitement) ou un tiers ?',NULL,NULL,'1.05',0,'Examples of legitimate interests would be fraud prevention or, in some cases, direct marketing.','Des exemples d\'intérêts légitimes seraient la prévention de la fraude ou, dans certains cas, la commercialisation directe.',0,0,0,0,NULL,'q-642841','sc',0,'Yes, No, Not App